import React from "react";
import { CustomButtonContainer } from "./custom-button.styles";

const CustomButton = ({
  children,
  signInWithGoogle,
  inverted,
  ...otherProps
}) => {
  return <CustomButtonContainer> {children}</CustomButtonContainer>;
};

export default CustomButton;
